import React, { useEffect, useState } from "react";
import {
  FaChartLine,
  FaPercentage,
  FaUpload,
  FaMoneyBillWave,
  FaCalendarAlt,
} from "react-icons/fa";
import { fetchDailyPnls } from "../api/DailyPNLApi";
import { formatDate } from "../func/functions";

const DailyPNL = () => {
  const [dailyPNLData, setDailyPNLData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDailyPNLData = async () => {
      try {
        const data = await fetchDailyPnls();
        if (data.length > 0) {
          // Sort data by entry_date to ensure the latest entry is displayed
          const sortedData = data.sort(
            (a, b) => new Date(b.entry_date) - new Date(a.entry_date)
          );
          setDailyPNLData(sortedData[0]); // Set the latest entry
        }
      } catch (error) {
        setError("Error fetching Daily PNL data");
        console.error("Error fetching Daily PNL data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchDailyPNLData();
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>{error}</p>;
  if (!dailyPNLData) return <p>No PNL data available</p>;

  return (
    <div className="daily-pnl-container">
      <div className="daily-pnl-card-container">
        <div className="daily-pnl-card">
          <div className="card-content">
            <FaCalendarAlt className="card-icon" />
            <span className="label">Entry Date:</span>
            <span className="value">{formatDate(dailyPNLData.entry_date)}</span>
          </div>
        </div>
        <div className="daily-pnl-card">
          <div className="card-content">
            <FaMoneyBillWave className="card-icon" />
            <span className="label">Open Cash:</span>
            <span className="value">${dailyPNLData.open_cash}</span>
          </div>
        </div>
        <div className="daily-pnl-card">
          <div className="card-content">
            <FaUpload className="card-icon" />
            <span className="label">Close Cash:</span>
            <span className="value">${dailyPNLData.close_cash}</span>
          </div>
        </div>
        <div className="daily-pnl-card">
          <div className="card-content">
            <FaChartLine className="card-icon" />
            <span className="label">Balance:</span>
            <span className="value">${dailyPNLData.balance}</span>
          </div>
        </div>
        <div className="daily-pnl-card">
          <div className="card-content">
            <FaPercentage className="card-icon" />
            <span className="label">RoI:</span>
            <span className="value">{dailyPNLData.roi}%</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default DailyPNL;
